import React from "react";
import {useState, useEffect } from "react";
import {Link} from "react-router-dom";
import Calendar from 'react-calendar';
import 'react-calendar/dist/Calendar.css';


function handleClickFunc(age, setAge) {
    setAge(age + 1);
}

// function handleAppointmentChange(appointmentDate, appointmentSetFunc) {
//
// }

function HomePage() {
    const [posts, setPosts] = useState(null);
    const [value, onChange] = useState(new Date());

    const bookAppointment = () => {
        console.log('booked appointment for ' + value);
    }
    const getDateString = () => {
        let dateString = value.toString().split(' ').splice(0, 4).join(' ');
        return dateString;
    }

    //Import Data
    useEffect(() => {
        getData();

        async function getData() {
            const apiURL = "api/posts"
            const response = await fetch(apiURL);
            const data = await response.json();
            console.log(data);
            setPosts(data);
        }
    }, []);


    return (
        [<div>
            <h1>Home</h1>
            <Calendar onChange={onChange}
                      value={value}/>
            <h3> Appointment Date: { getDateString() } </h3>
            <button onClick={bookAppointment}>Book Appointment</button>
            { posts && (
                <div>
                    {posts.map ((post, index) => (
                        <h5>{post.description}</h5>
                    ))}
                </div>
            ) }
            <Link to="/users">Users</Link>
        </div>]
    );
}

export default HomePage;
